  def _clean_all_activated_aids(aids)
    aids.each do |aid|  
      aid.delete("created_at")
      aid.delete("updated_at")
      aid.delete("archived_at")
      aid["filters"].map! do |slave_rule|
        slave_rule.select {|k,v| k == "id" }
      end
    end
    aids
  end

  def _clean_all_contracts(contracts)
